import React from 'react'
import './App.css'
import Home from './components/Home'
import Header from './components/Header'
import { Routes, Route, Link } from "react-router-dom";


const App = () => {
  return (
    <div>
       <Routes>
        
        <Route path="about" element={<Header />} />
        <Route path="/" element={<Home />} />
      </Routes>
    </div>
  )
}

export default App
